import { ReactElement, useEffect, useState } from "react";
import { IUser } from "./interfaces";
import api from "./services/api";

//rotas
import {Routes, Route, Link} from 'react-router-dom'
import Home from './templates/Home'
import Pagina1 from "./templates/Pagina1";


export default function App() {
  const [users, setUserGet] = useState([]);
  const elementUsers : Array<ReactElement> = [];
  let cont = 0;


  useEffect(() => {
   api
     .get("/v1/Users")
     .then((response) => ((setUserGet(response.data))))
     .catch((err) => {
       console.error("ops! ocorreu um erro" + err);
     });
  }, []);

  users.forEach((e: IUser) => {
    elementUsers.push(<div className="usuariosInfo" key={e.id}>
                        <p> <strong>Nome:</strong> {e.name} </p>
                        <p> <strong>Id:</strong> {e.id} </p> 
                        <p> <strong>Telefone:</strong> {e.phone} </p>
                      </div>
                  ) 
  })

  return (
    <div className="App">
      <head>
        <Link></Link>
      </head>
      <main>
        <Routes>
          <Route path="/" element={<Home/>}></Route>
          <Route path="/pag1" element={<Pagina1/>}></Route>
        </Routes>
      </main>
    </div>  
  );
}
